script: |
  super -f tsv -I q5534.sql | sort > q5534.out

vector: true

inputs:
  - name: q5534.sql
    data: |
      SELECT COUNT ( * ) AS col0, COUNT ( * ) - + + COUNT ( * ) FROM tab1 GROUP BY col2, col2 HAVING NOT COUNT ( * ) * + COUNT ( * ) * + + CAST ( NULL AS INTEGER ) + - 29 IS NOT NULL;
  - name: tab1

outputs:
  - name: q5534.out
    data: |
      1	0
      1	0
      1	0
